import React, { Fragment, useEffect } from "react";
import Button from '@mui/material/Button';
import { fetchHome } from "../apis/home";
//ダイアログ
import { SignUpDialog } from "../components/SignUpDialog"
import { LogInDialog } from "../components/LogInDialog"

export const Home = (props) => {


  //Home画面の更新
  useEffect(() => {
    fetchHome()
  }, [])

  // 返り値：Home画面
  return (
    <Fragment>
      <h1>HOME画面</h1>

      <Button variant="outlined" onClick={props.handleClickOpenSignUp}>
        新規登録
        <SignUpDialog open={props.open.signUpDialog} handleClose={props.handleCloseSignUp} handleLogin={props.handleLogin} />
      </Button>

      <Button variant="outlined" onClick={props.handleClickOpen}>
        ログイン
        <LogInDialog open={props.open === 'loginDialog'} handleClose={props.handleCloseLogIn} handleLogin={props.handleLogin} />
      </Button>

    </Fragment>
  )
}
